import React, { Suspense } from "react";
import "./App.css";
import "./Footer.css";
import { Loading } from "../shared/Loading";
import useAnalytics from "../hookls/useAnalytics";

const Router = React.lazy(() => import("./Router"));

export const App = () => {
  useAnalytics()
  return (
    <Suspense fallback={<Loading />}>
      <Router />
    </Suspense>
  );
};
